plot( barPositionDegreesFromMidline,  allDeltaYawResponses ); hold on
plot( barPositionDegreesFromMidline,  mean( allDeltaYawResponses ), '-k' );

xlabel( 'bar position (deg)')
ylabel( '\Delta Yaw of ball (deg)  ');
box off;
niceaxes;

title( 'Fly \Delta Yaw of ball (deg) as a function of flashed bar position, mean in black');
%% PLot yaw toward bar as a function of distance from midline

% solved for in 'cell' below using bootstrap X 10000000 repeat and bonferroni
% correction of 95% CI
ajustTop95 = 1.4134;
ajustBottom95 = -1.1934;

barPositionsToPLot = [7.5,15,22.5,30,37.5,45,52.5,60,67.5,75,82.5,90,97.5,105,112.5,120];
% positive yaw values are ball turning rightward

deltaYawTowardBar = [];
for i = 1: length( barPositionsToPLot )
    
    % find index where positive of ths bar positive value was shown
    indexOfPositiveBar = find( barPositionsToPLot(i) == barPositionDegreesFromMidline );
    
    % find index where negative of this bar positive value was shown
    indexOfNegativeBar = find( (-1)*barPositionsToPLot(i) == barPositionDegreesFromMidline );
    
    currPosReposnes = allDeltaYawResponses( :,  indexOfPositiveBar);
    % flip the turning sign for neg deg bar presentations
    currNegReponses = (-1)*allDeltaYawResponses( :,  indexOfNegativeBar);

    % add averaged values back into variable to save
    deltaYawTowardBar( :, i)  = mean( [currPosReposnes currNegReponses], 2 );
        
end

% this holds the yaw of the ball, flip sign to tranform to intended yaw of fly:
deltaYawOfFlyTowardBar = (-1)*deltaYawTowardBar;

figure; set(gcf, 'Color', 'w');
 
% individual fly traces:
plot( barPositionsToPLot, deltaYawOfFlyTowardBar , 'color',[0.9,0.9,0.9 ] ); hold on;
plot( barPositionsToPLot, mean( deltaYawOfFlyTowardBar ), '-k' ); hold on;

% % plot ajusted 95% confidence interval on plot
 plot( barPositionsToPLot, ajustTop95*ones( 1, length(barPositionsToPLot) ), '-r' ); hold on;
 plot( barPositionsToPLot, ajustBottom95*ones( 1, length(barPositionsToPLot) ), '-r' ); hold on;

% %STD of trace
deltaYawOfFlyTowardBar_STD =  std( deltaYawOfFlyTowardBar);
% top 1STD trace
plot( barPositionsToPLot,  mean( deltaYawOfFlyTowardBar )  + deltaYawOfFlyTowardBar_STD, '-c');
% bottom 1STD trace
plot( barPositionsToPLot,  mean( deltaYawOfFlyTowardBar )  - deltaYawOfFlyTowardBar_STD, '-c');

%ylim([- 20 , 20]);
xlabel( 'bar distance from midline (deg)');
ylabel( ' fly yaw toward flashed bar \Delta Yaw (deg)');
niceaxes; box off;
title('n = 68 flies, 73 cells, 1SD in cyan, 95% CI from bootstrap in red');


%% Bootstrap analysis to look at confidence interval for population average:
% plan: 1)Choose with replacement 73 values from the 73x16 matrix of all
% delta Yaw values
% 2) Take a mean of 73 choosen values and store this mean, repeat 100,000
% times
% 3) Find the 95% confidence interval of this group of means
NUMBER_OF_REPEATS_TO_RUN = 10000000;
numberOfCells = 73;

randomizedMean = [];

for i = 1: NUMBER_OF_REPEATS_TO_RUN
    
    randIndex =  randi( numel( deltaYawOfFlyTowardBar) , 1, numberOfCells );

    randomizedMean(i) = mean( deltaYawOfFlyTowardBar( randIndex ) );
end

%% Find 95% confidence interval w/ bonferroni correct
meanDeltaYaw = mean( deltaYawOfFlyTowardBar );

[bottom95, top95, ajustBottom95, ajustTop95] = plotPDFandCDF( randomizedMean );% find 95% CI 
ajustTop95
ajustBottom95


